import React, { useState } from 'react';
import {fetchData} from './api/fetchData';
import './App'

export const App = () => {

  const [query, setQuery] = useState('');

  return (
    <div className = "container">
      <input 
      type = 'text'
      className = 'search'
      placeholder = "Enter the tracking key"
      value = {query}
      onChange = {(e) => setQuery(e.targ)}
      />
    </div>
  )
}


export default App;
